import{_ as p}from"./plugin-vue_export-helper-c27b6911.js";import{o as _,c as e,e as t}from"./app-60a1dd49.js";const o={},c=t("<p>《三命通会》卷 九·六癸日癸丑时断</p><p>六癸日生时癸丑，支中暗鬼有刑伤；</p><p>月通身旺防妻损，丑巳遥合贵异常。</p><p>癸日癸丑时，支得隐鬼。</p><p>癸以己为偏官，丑中有暗己得位，癸以丁为妻，丑中丁火无气，若通身旺比肩之月，防损妻财。</p><p>柱丑寅多，以寅刑巳，丑合巳，刑出巳中，丙戊为财官，须干头无戊己字，大贵。</p><p>忌巳未卯破格。</p><p>癸丑日癸丑时，丑遥巳中丙戊为财官，若生丑寅申子酉三合年月，主妻贤于孝，荣贵特达；火土运凶；金水运吉。</p><p>癸卯日癸丑时，日贵格，身孤克，主贵。</p><p>丑寅辰年月，干支无戊己巳午卯字，极品。</p><p>癸巳日癸丑时，福德秀气格，学问聪明，英才特达，贵。</p><p>若纯丑巳年月，大贵。</p><p>癸未日癸丑时，子丑寅年月，贵，中年富。</p><p>卯月，行金水运，极品。</p><p>辰戌，四库全，大贵。</p><p>癸酉日癸丑时，福德秀气格，学问渊源，行藏进退，难为妻家。</p><p>癸亥日癸丑时，拱禄格，怕冲破、填实，柱无子巳午未字，大贵。</p><p>寅午戌月，南方运，六七品。</p><p>阴水重重时库收，少年难发莫强求；来受过中年后，安坐高堂任白头。</p><p>癸日时逢癸丑，水流金局盈冲，库逢戌未禄财丰，不过空乏难动。</p><p>无匙少年不显，有匙禄马和同，运来何用苦劳心，发达门庭大庆。</p>",21),r=[c];function s(n,a){return _(),e("div",null,r)}const f=p(o,[["render",s],["__file","276卷 九·六癸日癸丑时断.html.vue"]]);export{f as default};
